export interface Product {
    name: string;
    brand: string;
    price: string;
    rating: number;
    review: string;
    description: string;
    skintype: string;
    productImageUrl: string;
}

export const getProducts = async () : Promise<Product[]> => {
    const data = await (await fetch("https://julie-commerce.s3.us-west-2.amazonaws.com/moisturizer1_clean.csv")).text()

    return data.then(products => {
        return products.map(product => {
            const parts = product.split(',');
            return {
                name: parts[0],
                brand: parts[1],
                price: parts[2],
                rating: parseFloat(parts[3]),
                review: parts[4],
                description: parts[5],
                skintype: parts[6],
                productImageUrl: parts[7]
            }
        });
    })
}
